using System.Threading.Tasks;
using System.Collections.Generic;
using Cross2020TrabalhoFinalBasico.Models;

namespace Cross2020TrabalhoFinalBasico.Services
{
    public interface IItemService
    {
        Task<List<Item>> GetAll();
    }

    public sealed class ItemService : IItemService
    {
        public async Task<List<Item>> GetAll()
        {
            await Task.Delay(2000);

            return new List<Item>
            {
                Item.Create("Marvel 1", "Desc 1", "data:image/jpeg;base64,"),
                Item.Create("Marvel 2", "Desc 2", "data:image/jpeg;base64,"),
                Item.Create("Marvel 3", "Desc 3", "data:image/jpeg;base64,"),
            };
        }
    }
}
